// leetcode55

#include <iostream>
#include <vector>
using namespace std;
class Solution {
public:
    /*解法1*/
    bool canJump(vector<int>& nums) {
        if (nums.size() == 1) { return true; }
        int cover = 0;
        for (int i = 0; i <= cover; i++) 
        {
            cover = max(cover, nums[i] + i);
            if (cover >= nums.size() - 1) {
                return true;
            }
        }
        return false;
    }
    /*解法2超时*/
    bool canJumpbyTraversal(vector<int>& nums) 
    {
        if (nums.size() == 1) { return true; }
        traversal(0, 0, nums);
    }

    bool traversal(int start, int end, vector<int>& nums) 
    {
        if (end >= (nums.size()-1)) {
            return true;
        }
        for (int i = start; i <= end; i++) 
        {
            bool result = traversal(i + 1, i + nums[i], nums);
            if (result == true)return result;
        }
        return false;
    }
};
